Environment info:

```
Doctor summary (to see all details, run flutter doctor -v):
[√] Flutter (Channel stable, v1.5.4-hotfix.2, on Microsoft Windows [Version 10.0.17763.557], locale en-US)
[√] Android toolchain - develop for Android devices (Android SDK version 28.0.3)
[√] Android Studio (version 3.4)
[√] IntelliJ IDEA Ultimate Edition (version 2019.1)
[√] VS Code (version 1.33.1)
```

Steps to reproduce problem:

1) Create Flutter project
2) Create `unit/calculator.dart`:
```dart
int calculate(int a) {
  return a + 3;
}
```
3) Create `unit/test.dart`

```dart
import 'package:flutter_test/flutter_test.dart';

import 'calculator.dart';

void main() {
  group('simple', () {
    test('calculate', () {
      final value = calculate(2);

      expect(value, 5);
    });
  });
}
```

4) Place breakpoint on the line with `expect` to see the value of the variable `value`.
5) Run the program with `SHIFT + F10`
This is the command executed:
`flutter\bin\flutter.bat --no-color test --machine test\unit\test.dart`
6) Change the added value in the calculator:

```dart
int calculate(int a) {
  return a + 30;
}
```
7)  Run debug with `SHIFT + F9`
This is the command executed:
`flutter\bin\flutter.bat --no-color test --machine --start-paused test\unit\test.dart`

8) **Problem**: Old value is shown, code did not compile again.
